      out.write("\t\t\t\t//회원 리스트 직렬화\r\n");
      out.write("\t\t\t\tvar jsonStr = JSON.stringify(data);\r\n");
      out.write("\t\t\t\tvar json = JSON.parse(jsonStr);\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t//페이지 값 추출\r\n");
      out.write("\t\t\t\tcurrentPage = json.currentPage;\r\n");
      out.write("\t\t\t\tmaxPage = json.maxPage;\r\n");
      out.write("\t\t\t\tstartPage = json.startPage;\r\n");
