      out.write("\t\t\t\tjsonListSize = json.list.length;\r\n");
      out.write("\t\t\t\tjsonPwd = json.list\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\tvar values = \"\";\r\n");
      out.write("\t\t\t\tfor(var i in json.list){\r\n");
      out.write("\t\t\t\t\tvalues += \"<tr><td><input type='radio' onclick='radioCheck(\" + i + \")' name='choice' id='choice\" + i + \"'></td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='nametd\" + i + \"'>\" + decodeURIComponent(json.list[i].mname) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='idtd\" + i + \"'>\" + decodeURIComponent(json.list[i].mid) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='nicktd\" + i + \"'>\" + decodeURIComponent(json.list[i].mnick) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='snotd\" + i + \"'>\" + decodeURIComponent(json.list[i].msno) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='gendertd\" + i + \"'>\" + decodeURIComponent(json.list[i].mgender) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='phonetd\" + i + \"'>\" + decodeURIComponent(json.list[i].mphone) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='emailtd\" + i + \"'>\" + decodeURIComponent(json.list[i].memail) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='addresstd\" + i + \"'>\" + decodeURIComponent(json.list[i].maddress) + \"</td>\"\r\n");
      out.write("\t\t\t\t\t+ \"<td id='pointtd\" + i + \"'>\" +  json.list[i].mpoint + \"</td></tr>\";\r\n");
      out.write("\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\tpwdList.push(json.list[i].mpwd);\r\n");
      out.write("\t\t\t\t\t\r\n");
      out.write("\t\t\t\t} //for\r\n");
      out.write("\t\t\t\t$(\"#t1\").html(values); \r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t//페이징 처리\r\n");
      out.write("\t\t\t\tfor(var p = startPage; p <= endPage; p++){ \r\n");
      out.write("\t\t\t\t\tif(p == currentPage){\r\n");
      out.write("\t\t\t\t\t\t$(\"#domain\").html(domainHtml + \"<font color='red' size='4'>[\" + p + \"]</font>\");\r\n");
      out.write("\t\t\t\t\t}else{ \r\n");
      out.write("\t\t\t\t\t\t$(\"#domain\").html(domainHtml + \"<a href='#' onclick='paging(\" + p + \")'>\" + p + \"</a>\");\r\n");
      out.write("\t\t\t\t\t}\r\n");
